INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 7001, 1, 1, 1, 7, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", -363.0, 0, 0.0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 7002, 1, 1, 1, 7, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", -363.0, 0, 0.0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 7003, 1, 1, 1, 7, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", -363.0, 0, 0.0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 10001, 1, 1, 1, 10, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", -363.0, 0, 0.0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 10002, 1, 1, 1, 10, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", -363.0, 0, 0.0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 10003, 1, 1, 1, 10, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", -363.0, 0, 0.0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 2104010, 10004, 1, 1, 2, 10, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106401, "シェフィ", -363.0, 0, 0.0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 12001, 1, 1, 1, 12, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", -416.5, 0, 0.0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 13001, 1, 1, 1, 13, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", -363.0, 0, 0.0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 13002, 1, 1, 1, 13, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", -363.0, 0, 0.0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 2104010, 13003, 1, 1, 2, 13, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106401, "シェフィ", -363.0, 0, 0.0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 13004, 1, 1, 1, 13, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", -363.0, 0, 0.0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 14001, 1, 1, 1, 14, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", -363.0, 0, 0.0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 2104010, 14002, 1, 1, 2, 14, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106401, "シェフィ", -363.0, 0, 0.0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 14003, 1, 1, 1, 14, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", -363.0, 0, 0.0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 14004, 1, 1, 1, 14, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", -363.0, 0, 0.0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 15001, 1, 1, 1, 15, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", -470.0, 0, 0.0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 2104010, 16001, 1, 1, 2, 16, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106401, "シェフィ", -363.0, 0, 0.0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 16002, 1, 1, 1, 16, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", -363.0, 0, 0.0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 16003, 1, 1, 1, 16, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", -363.0, 0, 0.0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 16004, 1, 1, 1, 16, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", -363.0, 0, 0.0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 17002, 1, 1, 1, 17, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", -363.0, 0, 0.0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 17004, 1, 1, 1, 25, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", -363.0, 0, 0.0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 17005, 1, 1, 1, 25, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", -363.0, 0, 0.0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 2104010, 17006, 1, 1, 2, 25, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106401, "シェフィ", -363.0, 0, 0.0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 17007, 1, 1, 1, 25, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", -363.0, 0, 0.0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 18001, 1, 1, 1, 18, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", -363.0, 0, 0.0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 18002, 1, 2, 1, 18, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", -363.0, 0, 0.0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 19001, 1, 3, 1, 19, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", -470.0, 0, 0.0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 19002, 1, 4, 1, 19, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", -470.0, 0, 0.0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 20001, 1, 5, 1, 20, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", -470.0, 0, 0.0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 20002, 1, 6, 1, 20, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", -470.0, 0, 0.0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 21001, 1, 1, 1, 21, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", -363.0, 0, 0.0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 21002, 1, 1, 1, 21, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", -363.0, 0, 0.0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 2104010, 21003, 1, 1, 2, 21, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106401, "シェフィ", -363.0, 0, 0.0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 21004, 1, 1, 1, 21, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", -363.0, 0, 0.0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 22001, 1, 1, 1, 22, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", -430.0, 0, 0.0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 22002, 1, 2, 1, 22, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", -430.0, 0, 0.0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 23001, 1, 3, 1, 23, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", -430.0, 0, 0.0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 23002, 1, 4, 1, 23, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", -430.0, 0, 0.0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (4.08, 0, 24001, 2, 1, 1, 24, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109001, "エリコ（バレンタイン）", -385.0, 10011, 8.0, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (5.0, 0, 24002, 2, 2, 1, 24, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109001, "エリコ（バレンタイン）", -385.0, 10011, 8.0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (10.11, 0, 24003, 2, 3, 1, 24, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109001, "エリコ（バレンタイン）", -385.0, 10011, 8.0, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (4.0, 0, 24004, 2, 4, 1, 24, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109001, "エリコ（バレンタイン）", -385.0, 10011, 8.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (6.0, 0, 24005, 2, 5, 1, 24, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109001, "エリコ（バレンタイン）", -385.0, 10011, 8.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 24006, 1, 6, 1, 24, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109002, "エリコ（バレンタイン）", 0.0, 10011, 0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 24007, 1, 7, 1, 24, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109002, "エリコ（バレンタイン）", 0.0, 10011, 0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 24008, 1, 8, 1, 24, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109002, "エリコ（バレンタイン）", 0.0, 10011, 0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 24009, 1, 9, 1, 24, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109002, "エリコ（バレンタイン）", 0.0, 10011, 0.0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 24010, 1, 10, 1, 24, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109002, "エリコ（バレンタイン）", 0.0, 10011, 0.0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2.12, 0, 24011, 2, 1, 1, 24, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109101, "シズル（バレンタイン）", -385.0, 10011, 8.0, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (4.19, 0, 24012, 2, 2, 5, 24, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109101, "シズル（バレンタイン）", -385.0, 10011, 8.0, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2.3, 0, 24013, 4, 3, 2, 24, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109101, "シズル（バレンタイン）", -385.0, 10011, 8.0, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 24014, 1, 4, 1, 24, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109102, "シズル（バレンタイン）", 0.0, 10011, 0.0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (5.23, 0, 24015, 2, 5, 5, 24, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109101, "シズル（バレンタイン）", -385.0, 10011, 8.0, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 24016, 1, 6, 1, 24, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109102, "シズル（バレンタイン）", 0.0, 10011, 0.0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (5.01, 0, 24017, 2, 7, 1, 24, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109101, "シズル（バレンタイン）", -385.0, 10011, 8.0, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 24018, 1, 8, 1, 24, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109102, "シズル（バレンタイン）", 0.0, 10011, 0.0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 24019, 1, 9, 1, 24, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109102, "シズル（バレンタイン）", 0.0, 10011, 0.0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 24020, 1, 10, 1, 24, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 109102, "シズル（バレンタイン）", 0.0, 10011, 0.0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 2104010, 26001, 1, 1, 2, 26, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106401, "シェフィ", -363.0, 0, 0.0, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 26002, 1, 1, 1, 26, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", -363.0, 0, 0.0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 26003, 1, 1, 1, 26, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", -363.0, 0, 0.0, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 26004, 1, 1, 1, 26, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", -363.0, 0, 0.0, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 2104010, 27001, 1, 1, 2, 27, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106401, "シェフィ", -363.0, 0, 0.0, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 27002, 1, 1, 1, 27, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", -363.0, 0, 0.0, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 27003, 1, 1, 1, 27, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", -363.0, 0, 0.0, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 27004, 1, 1, 1, 27, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", -363.0, 0, 0.0, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 28001, 1, 1, 1, 28, "2030/12/17 14:59:59", "2019/09/24 15:00:00", 190801, "カリン", -363.0, 0, 0.0, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 28002, 1, 2, 1, 28, "2030/12/17 14:59:59", "2019/09/24 15:00:00", 190801, "カリン", -363.0, 0, 0.0, "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 29001, 1, 3, 1, 29, "2030/12/17 14:59:59", "2019/09/24 15:00:00", 190801, "カリン", -409.0, 0, 0.0, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 29002, 1, 4, 1, 29, "2030/12/17 14:59:59", "2019/09/24 15:00:00", 190801, "カリン", -409.0, 0, 0.0, "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 30001, 1, 5, 1, 30, "2030/12/17 14:59:59", "2019/09/24 15:00:00", 190801, "カリン", -409.0, 0, 0.0, "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 30002, 1, 6, 1, 30, "2030/12/17 14:59:59", "2019/09/24 15:00:00", 190801, "カリン", -409.0, 0, 0.0, "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 31001, 1, 7, 1, 31, "2030/12/17 14:59:59", "2019/10/31 12:00:00", 190801, "カリン", -409.0, 0, 0.0, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 31002, 1, 8, 1, 31, "2030/12/17 14:59:59", "2019/10/31 12:00:00", 190801, "カリン", -409.0, 0, 0.0, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 32001, 1, 1, 1, 32, "2020/01/04 4:59:59", "2019/12/20 5:00:00", 190801, "カリン", -409.0, 0, 0.0, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 32002, 1, 2, 1, 32, "2020/01/04 4:59:59", "2019/12/20 5:00:00", 190801, "カリン", -409.0, 0, 0.0, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 33001, 1, 3, 1, 33, "2020/01/04 4:59:59", "2019/12/20 5:00:00", 190801, "カリン", -409.0, 0, 0.0, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 33002, 1, 4, 1, 33, "2020/01/04 4:59:59", "2019/12/20 5:00:00", 190801, "カリン", -409.0, 0, 0.0, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 34001, 1, 5, 1, 34, "2020/01/10 11:59:59", "2020/01/04 5:00:00", 190801, "カリン", -409.0, 0, 0.0, "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 34002, 1, 6, 1, 34, "2020/01/10 11:59:59", "2020/01/04 5:00:00", 190801, "カリン", -409.0, 0, 0.0, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (5.3, 0, 38001, 2, 1, 1, 38, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", -458.0, 0, 0.0, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (6.5, 0, 38002, 2, 2, 1, 38, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", -458.0, 0, 0.0, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 39005, 3, 0, 3, 39, "2020/04/08 23:59:59", "2020/04/01", 105801, "ペコリーヌ", 9999.0, 0, 9999.0, "");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 40001, 1, 2, 1, 40, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 190801, "カリン", -430.0, 0, 0.0, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 2104010, 41001, 1, 1, 1, 41, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106401, "シェフィ", -363.0, 0, 0.0, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 41002, 1, 1, 1, 41, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", -363.0, 0, 0.0, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 41003, 1, 1, 1, 41, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", -363.0, 0, 0.0, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 41004, 1, 1, 1, 41, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", -363.0, 0, 0.0, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 42001, 1, 1, 1, 42, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", -416.5, 0, 0.0, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 2104010, 42002, 1, 1, 1, 42, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106401, "シェフィ", -416.5, 0, 0.0, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 42003, 1, 1, 1, 42, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", -416.5, 0, 0.0, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 42004, 1, 1, 1, 42, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", -416.5, 0, 0.0, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 43001, 1, 1, 1, 43, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105801, "ペコリーヌ", -363.0, 0, 0.0, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 43002, 1, 1, 1, 43, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 105901, "コッコロ", -363.0, 0, 0.0, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 43003, 1, 1, 1, 43, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 106001, "キャル", -363.0, 0, 0.0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 43004, 1, 1, 1, 44, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 123001, "アメス", -416.5, 0, 0.0, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 43005, 1, 2, 1, 44, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 123001, "アメス", -416.5, 0, 0.0, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (5.79, 0, 43006, 2, 3, 1, 45, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 123001, "アメス", -416.5, 0, 0.0, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？");
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0.0, 0, 46001, 1, 1, 1, 46, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 123001, "アメス", -371.5, 0, 0.0, "はい、お疲れ様。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。");
